import React, { useState } from 'react';
import { useHistory } from 'react-router-dom';
import './RegistrationPage.css';

function RegisterPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [confirmPassword, setConfirmPassword] = useState('');
  const history = useHistory();

  const handleSubmit = (event) => {
    event.preventDefault();

    // Validar se os campos estão preenchidos corretamente
    if (email && password && confirmPassword && password === confirmPassword) {
      // Aqui você pode adicionar lógica para enviar os dados para o servidor ou fazer o que for necessário para o registro do usuário
      history.push('/login'); // Redirecionar para a página de login após o registro bem-sucedido
    } else {
      alert('Por favor, preencha todos os campos corretamente.');
    }

    console.log('Registrando:', email, password);
  };

  return (
    <section className="container forms">
        <h1>fdsafdas</h1>
      <div className="form signup">
        <div className="form-content">
          <header>Registro</header>
          <form onSubmit={handleSubmit}>
            <div className="field input-field">
              <input
                type="email"
                placeholder="Email"
                className="input"
                value={email}
                onChange={(e) => setEmail(e.target.value)}
              />
            </div>

            <div className="field input-field">
              <input
                type="password"
                placeholder="Criar senha"
                className="password"
                value={password}
                onChange={(e) => setPassword(e.target.value)}
              />
            </div>

            <div className="field input-field">
              <input
                type="password"
                placeholder="Confirmar senha"
                className="password"
                value={confirmPassword}
                onChange={(e) => setConfirmPassword(e.target.value)}
              />
            </div>

            <div className="field button-field">
              <button type="submit">Registro</button>
            </div>
          </form>

          <div className="form-link">
            <span>Já tem uma conta? <a href="/login" className="link login-link">Login</a></span>
          </div>
        </div>

        <div className="line"></div>

        <div className="media-options">
          <a href="#" className="field facebook">
            <i className='bx bxl-facebook facebook-icon'></i>
            <span>Registro com o Facebook</span>
          </a>
        </div>

        <div className="media-options">
          <a href="#" className="field google">
            <img src="#" alt="" className="google-img" />
            <span>Registro com o Google</span>
          </a>
        </div>
      </div>
    </section>
  );
}

export default RegisterPage;
